import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Link,
  Route,
  Switch
} from 'react-router-dom';
import Main from './Main.js';

function App() {
  return (
    <div className="App">
      <Router>
        <div className="container text-center">
          <div id="title-div" className="mt-5">
            <Link to="/"><h1 className="heading-4 " id="title">Trace - The - Bug</h1></Link>
          </div>
        </div>

        <Switch>
          <Route exact path="/">
            <Main />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
